import React from 'react';
import ApiTodos from './ApiTodos'

const ApiTodoList = ({ apiTodos, setApiTodos, apiFilteredTodos }) => {
  return (
    <div className='todo-container'>
      <ul className='todo-list'>
        {apiFilteredTodos.map((Todo) => (
          <ApiTodos 
            setApiTodos={setApiTodos} 
            apiTodos={apiTodos}
            Todo={Todo}
            text={apiTodo.text} 
            key={Todo.id} 
          />
        ))}
      </ul>
    </div>

  )
}

export default ApiTodoList
